        private string CreateExcelFile()
        {
            // start Excel book
            _c1xl.Clear();
            XLSheet sheet = _c1xl.Sheets[0];
            sheet.Name = "Formatting";

            // apply default/header row styles
            _c1xl.DefaultFont = new Font("Tahoma", 8);
            sheet.DefaultColumnWidth = 2000; // twips
            XLStyle s = new XLStyle(_c1xl);
            s.Font = new Font("Tahoma", 10, FontStyle.Bold);
            sheet.Rows[0].Style = s;
            s = new XLStyle(_c1xl);
            s.Font = new Font("Tahoma", 8, FontStyle.Bold);
            sheet.Rows[1].Style = s;

            // create numeric colums with different formats:
            AddColumn("Currency", "c", -10000, 10000);
            AddColumn("Fixed", "f", -10000, 10000);
            AddColumn("Fixed (0)", "f0", -10000, 10000);
            AddColumn("Fixed (4)", "f4", -10000, 10000);
            AddColumn("Percent", "p", -100, 100);
            AddColumn("Percent (0)", "p0", -100, 100);
            AddColumn("Percent (3)", "p3", -100, 100);
            AddColumn("Custom", "#,###.00", -10000, 10000);
            AddColumn("Custom (0)", "#,##0", -10000, 10000);

            // create some date/time columns with different formats
            AddColumn("Short date", "d");
            AddColumn("Long date", "D");
            AddColumn("Short time", "t");
            AddColumn("Long time", "T");
            AddColumn("Full date time", "f");
            AddColumn("Custom", "dd-MM-yy");
            AddColumn("Custom", "MMM yy, hh:mm:ss");

            // save xls file
            string filename = GetTempFileName(".xls");
            _c1xl.Save(filename);

            return filename;
        }

        private void AddColumn(string title, string format, double min, double max)
        {
            XLSheet sheet = _c1xl.Sheets[0];
            int col = sheet.Columns.Count;

            // add header information to column
            sheet[0, col].Value = title;
            sheet[1, col].Value = format;

            // apply style with given format to entire column
            XLStyle s = new XLStyle(_c1xl);
            s.Format = XLStyle.FormatDotNetToXL(format, typeof(double));
            sheet.Columns[col].Style = s;

            // add some random values
            Random rnd = new Random();
            for (int row = 2; row < 100; row++)
            {
                sheet[row, col].Value = min + rnd.NextDouble() * (max - min);
            }
        }

        private void AddColumn(string title, string format)
        {
            XLSheet sheet = _c1xl.Sheets[0];
            int col = sheet.Columns.Count;

            // add header information to column
            sheet[0, col].Value = title;
            sheet[1, col].Value = format;

            // apply style with given date/time format to entire column
            XLStyle s = new XLStyle(_c1xl);
            s.BackColor = Color.Beige;
            s.Format = XLStyle.FormatDotNetToXL(format, typeof(DateTime));
            sheet.Columns[col].Style = s;

            // add some random values
            Random rnd = new Random();
            for (int row = 2; row < 100; row++)
            {
                sheet[row, col].Value = DateTime.Now.AddDays(rnd.NextDouble() * 365f);
            }
        }

